import React from 'react';

import CarouselSlider from "react-carousel-slider";
import { useNavigate } from 'react-router-dom';  
import '../styles/HomePage.css';

import { Link } from 'react-router-dom';






const HomePage = () => {

    let data = [
        {
          id: "1",
          imgSrc: "https://i.ibb.co/fnJ3Xtx/img1-3.jpg"
        },
        {
          id: "2",
          imgSrc: "https://i.ibb.co/XCRD4tt/img2.png"
        },
        {
          id: "3",
          imgSrc: "https://i.ibb.co/1bBkfYk/ezgif-com-webp-to-jpg-3.jpg"
        },
        {
          id: "4",
          imgSrc: "https://i.ibb.co/LkjNyq4/img4.jpg"
        },
        {
          id: "5",
          imgSrc: "https://i.ibb.co/58rMHCx/fin-2.jpg"
        }
      ];
      let manner = {
        autoSliding: { interval: "2s" }
      };
      let buttonSetting = {
        placeOn: "bottom-beneath",
        //hoverEvent: true,
        style: {
          left: {
            margin: "0px 10px 0px 10px"
          },
          right: {
            margin: "0px 10px 0px 0px"
          }
        }
      };
      let itemsStyle = {
        margin: "0px 0px",
        padding: "0px",
        height:"500px",
        enlargeFactor: 0.3,
        
  
       
       
        
      };

      
   
    const navigate = useNavigate();

    const handleLogout = () => {
        navigate('/', { replace: true });
    };

    return (
        <div className="home-page-container">
            

            <nav className="top-navbar">
                <div className="menu-dropdown">
                    <p className="menu-icon">â˜°<b>Menu</b></p>
                    

                    <div className="side-menu">
                        <ul>
                            <li> <Link to="/TrackHealth" style={{ textDecoration: 'none' ,color: 'black'}}>Track Your Health</Link></li>
                            <li ><Link to="/HeartHealthData" style={{ textDecoration: 'none' ,color: 'black'}}>Previous risk levels</Link></li>
                            <li ><Link to="/Profile" style={{ textDecoration: 'none' ,color: 'black'}}>Profile Page</Link></li>
                            <li ><Link to="/bmi" style={{ textDecoration: 'none' ,color: 'black'}}>Calculate BMI</Link></li>
                            <li onClick={handleLogout}>Logout</li>
                        </ul>
                    </div>
                </div>

                <div className="nav-title">
                    <span className="stethoscope-icon">ðŸ©º</span>
                    Healthcare Analytics
                </div>



                
                <div style={{ width: 'fit-content' }}></div>
            </nav>
            

            {/* <div className="info-container">
                <h1>Heart Care Information</h1>
                <p>Heart diseases are among the leading causes of death globally. Regular check-ups, a balanced diet, and an active lifestyle are essential for heart health.</p>
                <h2>Common Misconceptions</h2>
                <ul>
                    <li>Young people don't have to worry about heart disease.</li>
                    <li>If you have heart disease, you should avoid exercise.</li>
                    <li>Diet doesn't affect heart health.</li>
                    <li>Only the elderly are at risk of heart disease.</li>
                </ul>
            </div> */}
<div class="info-container" >
<div className="CarouselSlider">
      <CarouselSlider
        slideItems={data}
        manner={manner}
        buttonSetting={buttonSetting}
        itemsStyle={itemsStyle}
      />
    </div>

    
          <div>
            <img src="https://i.ibb.co/9gJQRbL/abstract-hexagon-pattern-dark-blue-background-medical-and-science-concept-molecular-structures-free.jpg" alt="Add Cards" />
              <h3>Add Cards</h3>
              <p>Add the flashcards of your choice related to organic chemistry either it can be a definition or a formula and use those flashcards to conduct a quiz for yourself.</p>
            </div>
          

    </div>

    </div>
      
    );
        };

export default HomePage;
